///                                    ###
///                                    * 1: Reduce the leakage(low power) mode , allows VDD to be switched off with data retention
///                                    * 0: Normal operation
///                                    ###
///               %unsigned 1  PDLVMC2                   0x0
///                                    ###
///                                    * 1: To select leakage reduction mode options when PDWN is asserted
///                                    * 0: Normal operation
///                                    ###
///               %unsigned 1  PDFVSSM2                  0x0
///                                    ###
///                                    * 1: To select leakage reduction mode options when PDWN is asserted
///                                    * 0: Normal operation
///                                    ###
///               %%        13         # Stuffing bits...
///     @ 0x00004                      (W-)
