//////
/// 
/// $INTERFACE WriteCmd                                 (4,4)
///     # # ----------------------------------------------------------
///     @ 0x00000 CTRL0                (P)
///               %unsigned 1  RS_Mode_en                0x0
///                                    ###
///                                    * Mode selection for DHUB write Command generation.
///                                    * 1 : Raster Scan Mode. (detile & rotate)
///                                    * 0 : Tile Mode. (rotate only)
///                                    ###
///               %unsigned 9  burst_size                0x100
///                                    ###
///                                    * AXI/DHUB burst size in bytes.
///                                    * Supported values are 256 and 64.
///                                    * Default is 256 bytes.
///                                    * Not used in Tile Mode
///                                    ###
///               %unsigned 1  dHubIrqEnY                0x1
///                                    ###
///                                    * Enable bit for command completion for Luma plane
///                                    * 1: DHUB will generate interrupt on completion of the last command of the frame.
///                                    * 0: DHUB will not generate any command completion interrupt.
///                                    ###
///               %unsigned 1  dHubIrqEnC                0x1
///                                    ###
///                                    * Enable bit for command completion for Chroma plane
///                                    * 1: DHUB will generate interrupt on completion of the last command of the frame.
///                                    * 0: DHUB will not generate any command completion interrupt.
///                                    ###
///               %unsigned 2  YUVmode                   0x0
///                                    ###
///                                    * Reserved.
///                                    ###
///               %unsigned 4  nDhubCmds_tl              0x1
///                                    ###
///                                    * Reserved.
///                                    ###
///               %unsigned 1  dhubWr_losMsk             0x0
///                                    ###
///                                    * Reserved.
///                                    ###
///               %unsigned 1  dhubWr_lgdcLosMsk         0x0
///                                    ###
///                                    * Reserved.
///                                    ###
///               %%        12         # Stuffing bits...
///     @ 0x00004 CTRL1                (P)
///               %unsigned 16 bytLineTot                0x20
///                                    ###
///                                    * Total number of bytes in each line rounded up to burst boundary. Not used in Tile Mode
///                                    * ceil(LB/burst_size)*burst_size
///                                    * LB = (HRES*BPC)/8.
///                                    * HRES = Horizontal resolution
///                                    * BPC = Bits per component
///                                    ###
///               %unsigned 9  TileHwidth                0x8
///                                    ###
///                                    * Set this to output Tile width (8 or 6) when MTR is OFF.
///                                    * Set this to 48 when MTR is ON ( for 512 byte burst size)
///                                    ###
///               %unsigned 4  TileVdepth                0x8
///                                    ###
///                                    * Output Tile depth or height
///                                    * supported values are 8 and 6.
///                                    ###
///               %%        3          # Stuffing bits...
///     @ 0x00008 CTRL2                (P)
///               %unsigned 32 BaseAddrY                 0x0
///                                    ###
///                                    * Base address for Luma Frame
///                                    ###
///     @ 0x0000C CTRL3                (P)
///               %unsigned 32 BaseAddrC                 0x0
///                                    ###
///                                    * Base address for Chroma Frame
///                                    ###
///     @ 0x00010 CTRL4                (P)
///               %unsigned 20 Stride                    0x0
///                                    ###
///                                    * For Raster scan Mode,
///                                    * Number of bytes in one line rounded up to burst size.
///                                    * ceil(LB/burst_size)*burst_size
///                                    * LB = (HRES*BPC)/8
///                                    * HRES = Horizontal resolution
///                                    * BPC = Bits per component
///                                    * e.g: For 240x80, YUV420-10b-DWA, burst_size=64
///                                    * LB=(240*10)/8 = 300
///                                    * Stride = ceil(300/64)*64 = 320.
///                                    * For Tile Mode,
///                                    * Number of bytes in one tile stride.
///                                    * ceil(HRES/tile width)*tile size
///                                    * tile size = Number of bytes in a tile = 64 (for V8H8, V8H6, V6H8)
///                                    ###
///               %%        12         # Stuffing bits...
///     @ 0x00014 CTRL5                (P)
///               %unsigned 20 StrideJump                0x0
///                                    ###
///                                    * Address jump for each stride.
///                                    * Should be configured to value greater than or equal to Stride.
///                                    * Recommended:
///                                    * In RS mode, StrideJump = Stride
///                                    * In Tile mode,
///                                    * StrideJump=ceil(LB/burst_size)*burst_size*TileVdepth
///                                    * LB = (HRES*BPC)/8
///                                    * e.g:
///                                    * (1) For V8H8, 240x80, burst_size = 64
///                                    * LB = (240*8)/8 = 240
///                                    * StrideJump = ceil(240/64)*64*8 = 2048
///                                    * (2) For V6H8, 240x80, burst_size = 64
///                                    * LB = (240*10)/8 = 300
///                                    * StrideJump = ceil(300/64)*64*6 = 1920
///                                    * (3) For V8H6, 240x80, burst_size = 64
///                                    * LB = (240*10)/8 = 300
///                                    * StrideJump = ceil(300/64)*64*8 = 2560
///                                    ###
///               %%        12         # Stuffing bits...
///     @ 0x00018 CTRL6                (P)
///               %unsigned 16 nStrides                  0x0
///                                    ###
///                                    * Number of tile strides
///                                    * ceil(VRES/TileVdepth)
///                                    ###
///               %unsigned 16 Chroma_nStrides           0x0
///                                    ###
///                                    * Number of tile strides in chroma plane
///                                    * ceil((VRES/2)/TileVdepth) – for YUV420
///                                    * ceil(VRES/TileVdepth) – for YUV422
///                                    ###
///     # # ----------------------------------------------------------
/// $ENDOFINTERFACE  # size:      28B, bits:     185b, padding:     0B
////////////////////////////////////////////////////////////
