///                                    ###
///     @ 0x0006C                      (P)
///     # 0x0006C UPS420_422Main_C     
///               $UPS_420_422         UPS420_422Main_C  REG          
///                                    ###
///                                    * UPS registers for 420-> 422 UPS & coefficients for Croma Component
///                                    ###
///     @ 0x00098                      (P)
///     # 0x00098 DTILE                
///               $DTILE               DTILE             REG          
///                                    ###
///                                    * Control registers of Detile & Rotate path
///                                    ###
///     @ 0x000B0                      (P)
///     # 0x000B0 feTG                 
///               $TG_MAINB            feTG              REG          
///                                    ###
///                                    * dummy TG for (front end Video path).
